smart_car_controller::smart_car_controller(ros::NodeHandle &n){
    ROS_INFO("controller init");
    // comUart = new smart_car_communicator();

    state_pub_ = n.advertise<nav_msgs::Odometry>("/Odometry/ekf_estimated", 10);
    reference_path_pub_ = n.advertise<nav_msgs::Path>("/Path/LocalWaypoint/OnBody", 10);
    track_boundary_left_pub_ = n.advertise<nav_msgs::Path>("/mpc/left_boundary", 10);
    track_boundary_right_pub_ = n.advertise<nav_msgs::Path>("/mpc/right_boundary", 10);


    // trackPublish();
    // 开启线程
    thread mainThread(&smart_car_controller::controllerThreadHandle, this);
    mainThread.detach();
}

smart_car_controller::~smart_car_controller(){
    delete comUart;
}

